import React, {Component} from 'react';
import { connect } from 'react-redux';
import { playCatch } from '../actions'

class Commands extends Component{
  render() {
    return(
      <React.Fragment> 
        <button onClick={eatFood}>Eat Food</button>
        <button onClick={sleep}>Sleep</button>
        <button onClick={playCatch}>Play Catch</button>
      </React.Fragment>
    )
  }
}

const mapDispatchToProps = (dispatch) => {
  return {
    eatFood: () => dispatch(eatFood()),
    sleep: () => dispatch(goToSleep()),
    playCatch: () => dispatch(playCatch())
  }
}

export default connect(mapDispatchToProps)(Commands)
